var photos, carousel;


photos = ['data:image/jpeg;base64,', 'data:image/jpeg;base64,', 'https://64.media.tumblr.com/85695d86d036208043553d011b673dec/tumblr_plrfz69B7L1xnzt25o5_500.jpg', 'data:image/jpeg;base64,', 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTn4S20VJOOkasCi4FPZmYLr7DE-74alkFMEQ&usqp=CAU'];
let element_images = document.getElementById('images');
carousel = photos.shift();
element_images.setAttribute("src", carousel);
photos.unshift(carousel);


document.getElementById('next').addEventListener('click', (event) => {
  let element_images2 = document.getElementById('images');
  carousel = photos.shift();
  element_images2.setAttribute("src", carousel);
  photos.push(carousel);

});

document.getElementById('previous').addEventListener('click', (event) => {
  let element_images3 = document.getElementById('images');
  element_images3.setAttribute("src", carousel);
  carousel = photos.pop();
  photos.unshift(carousel);

});

function getNumberOrString(value) {
  // Convert a string value to a number if possible
  let number_value = Number(value);
  if (Number.isNaN(number_value)) {
    return value
  } else {
    return number_value
  }
}



document.getElementById('submit').addEventListener('click', (event) => {
  let element_list = document.getElementById('list');
  let new_li = document.createElement('li');
  new_li.innerText = getNumberOrString(document.getElementById('text').value);

  element_list.appendChild(new_li);

});